import React,{useState} from "react";
import Score from "./components/Score";

const MainView = ({scoreData, keys}) => {
    

    return (
        <div>
            <div>
                <Score scoreData={scoreData} keys={keys} />
            </div>
        </div>
    );
}

export default MainView;
